import React, { useState, useEffect } from "react";
import { Grid, TextField } from "@material-ui/core";

const AbaUpdate = ({ dadosDoBackEnd }) => {
  const [dados, setDados] = useState({
    nome: "",
    pontoInicial: "",
    pontoFinal: "",
    tamanho: ""
  });

  useEffect(() => {
    // Aqui você pode fazer uma chamada para o backend para obter os dados e atualizar o estado
    // Por exemplo:
    // fetchDadosDoBackEnd().then((response) => setDados(response));
    // Isso é apenas um exemplo. Certifique-se de implementar de acordo com sua lógica de backend.
  }, []);

  return (
    <Grid container spacing={3}>
      <Grid item xs={12} sm={6} md={3}>
        <TextField
          label="Nome"
          variant="outlined"
          fullWidth
          value={dados.nome}
          disabled
        />
      </Grid>
      <Grid item xs={12} sm={6} md={3}>
        <TextField
          label="Ponto Inicial"
          variant="outlined"
          fullWidth
          value={dados.pontoInicial}
          disabled
        />
      </Grid>
      <Grid item xs={12} sm={6} md={3}>
        <TextField
          label="Ponto Final"
          variant="outlined"
          fullWidth
          value={dados.pontoFinal}
          disabled
        />
      </Grid>
      <Grid item xs={12} sm={6} md={3}>
        <TextField
          label="Tamanho"
          variant="outlined"
          fullWidth
          value={dados.tamanho}
          disabled
        />
      </Grid>
    </Grid>
  );
};

export default AbaUpdate;
